import axios from "axios";
import key from "./key.js"


export default {
    getNutrition(query) {
        console.log(key);
        return axios.get(`https://developer.nrel.gov/api/alt-fuel-stations/v1/nearest.json?api_key=${key.key}&location=Denver+CO`)
    }
}
